import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

import Navbar from "./components/navbar.component"
import HomePage from "./components/homepage.component";
import CreateUser from "./components/create-user.component";
import Dashboard from "./components/dashboard.component";
import ExpensesList from "./components/expenses-list.component";
import EditExpense from "./components/edit-expense.component.js";
import CreateExpense from "./components/create-expense.component";

function App() {
  return (
    <Router>
      <div className="container">
        <Navbar />
        <br/>
        <Route path="/" exact component={HomePage} />
        <Route path="/user" component={CreateUser} />
        <Route path="/dashboard" exact component={Dashboard} />
        <Route path="/dashboard/expenses" exact component={ExpensesList} />
        <Route path="/dashboard/expenses/edit/:id" component={EditExpense} />
        <Route path="/dashboard/expenses/add" component={CreateExpense} />
      </div>
    </Router>
  );
}

export default App;
